import React from "react";
import ".//Swedish.css";
import MailLogo from "../shared/images/mail.jpg";

export const Home = () => {
  return (
    <div>
      <h3 className="text">• Kontakt •</h3>
      <div className="swe_erfarenhet">
        <div className="swe_company">
          <img className="logos" src={MailLogo}></img>
        </div>
        <div classname="head"></div>
        <button
          className="head"
          onClick={() => (window.location = "mailto:m.karlsson8@icloud.com")}
        >
          Mail Contact
        </button>
      </div>
    </div>
  );
};
